import React from "react";
const conteudos = [
  {
    conteudo: "High Order Functions",
    bloco: 8,
    status: "Aprendido",
  },
  {
    conteudo: "Composicao de Componentes",
    bloco: 11,
    status: "Aprendendo",
  },
  {
    conteudo: "Composicao de Estados",
    bloco: 12,
    status: "Aprenderei",
  },
  {
    conteudo: "Redux",
    bloco: 16,
    status: "Aprenderei",
  },
];
class Content extends React.Component {
  render() {
    return (
      <div>
        {conteudos.map((obj) => {
          <div key={obj.conteudo}>
            <p>{`O conteudo é: ${obj.conteudo}`}</p>;
            <p>{`Status: ${obj.status}`}</p>;<p>{`Bloco: ${obj.bloco}`}</p>;
          </div>;
        })}
      </div>
    );
  }
}
export default Content;
